\[Tau]ph = (qh^2*Vf[\[Lambda]h, \[Tau]h]*w[\[Lambda]h]^2*Derivative[0, 1][Vf][\[Lambda]h, \[Tau]h])/
 (fph*nt^2*\[Kappa][\[Lambda]h] + fph*Vf[\[Lambda]h, \[Tau]h]^2*w[\[Lambda]h]^2*\[Kappa][\[Lambda]h]);

fpph = (fph*(12 - (12*(7*nt^2 + 4*Vf[\[Lambda]h, \[Tau]h]^2*w[\[Lambda]h]^2 - 4*Vf[\[Lambda]h, \[Tau]h]*Vg[\[Lambda]h]*
